#include "bits/stdc++.h"

using namespace std;

class Solution {
public:
    int countCompleteSubstrings(string word, int k) {
        int len = word.length();
        int ans = 0;
        int i = 0;
        unordered_map<char, int> freqs;

        while (i <= len - k) {
            freqs.clear();
            bool isValid = true;
            int isJump = 0;
            for (int j = i; j < len; ++j) {
                freqs[word[j]]++;
                if (freqs[word[j]] > k) break;
                if (freqs[word[j]] == 1 && (freqs.size() * k + i) > len) {
//                    cout << word.substr(i, j+1) << endl;
                    isJump = j - i;
                    cout << "isJump " << isJump << endl;
                    i += isJump;
                    break;
                }
                if (k == 1 && j == i) {
                    ans++;
//                    cout << "i:" << i << " j: " << j << endl;
//                    cout << "nice: " << word.substr(i, j-i+1) << endl << endl;

                    continue;
                }
                if (j > i && abs(word[j] - word[j - 1]) > 2) {
                    isJump = j - i;
//                    cout << "j:" << j << " " << word[j - 1] << " " << word[j] <<  " " << i << " " << "jumpto: "
//                         << isJump + i << endl << endl;
                    break;
                };

                if ((j - i + 1) >= k && (j - i + 1) % k == 0) {
//                    cout << "i:" << i << " j: " << j << endl;
//                    cout << "test: " << word.substr(i, j - i + 1) << endl << endl;
                    isValid = true;
                    for (const auto &freq: freqs) {
//                        cout << freq.first << " " << freq.second << endl;
                        if (freq.second != k) {
                            isValid = false;
                            break;
                        }
                    }
                    if (isValid) {
                        ans++;
//                        cout << "nice: " << word.substr(i, j - i + 1) << endl;
//                        cout << endl;
                    };
                }
            }
            if (isJump) {
                if (isJump && k > isJump) i += isJump;
            } else
                i++;

        }

        return ans;
    }

};

int main() {
    Solution s;

    string word = "";
    cout << "word.size:" << word.size() << endl;
    cout << s.countCompleteSubstrings(word, 3846);
//    cout << s.countCompleteSubstrings(word, 12210);

}